import { AppBar, Toolbar, Typography } from '@mui/material'
import React from 'react'

const Title_page=()=> {
  return (
   <AppBar sx={{background:'#333333'}}>
    <Toolbar sx={{padding:'20px'}}>
        <Typography variant='h3'> My-website </Typography>
    </Toolbar>
   </AppBar>
  )
}

export default Title_page
